import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <p>Disclaimer and terms to use: This model predicts that you are (not) at higher risk for obstructive sleep apnea. A user must agree that this is a prediction, not a clinical diagnosis. Only your health care provide can diagnose you whether you have obstructive sleep apnea or not. You may discuss with your health care provider about this prediction result. You and your health care provider can choose to ignore this result. The tool has an average accuracy of 71.8% predicting if a person has a moderate to severe sleep apnea (AHI >15) and an average accuracy of 63.2% if a person does not have a moderate to severe sleep apnea (AHI â‰¤15). Neither accuracy is 100%. Many other factors such as comorbidities are not included in the model.</p>
    <App />
  </React.StrictMode>
);

